import React, { Component } from "react";

import "./App.css";
import "./About.css";


class Project extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Project">
        <div className="para">
          <h1>
          Apologies!
          </h1>
          <p>
          This part of this website is under development.
          </p>
        </div>
      </div>
    );
  }
}

export default Project;
